(1231,723307,'2024-09-20',9,2024,570.69,'3.01 RESULTADO OPERACIONAL:3.01.01 RECEITA BRUTA:3.01.01.01 - Receita bruta - Contrato PF','3.01.01.01','RECEITA_PF',0,'Luiz Alberto de Souza','1. Atividades Judiciais Contenciosas ou Voluntárias','Referente à atividade judicial realizada no processo nº 5029702-26.2021.8.24.0033, envolvendo o inventariante Luiz Alberto de Souza. No dia 01/07/2024, foi apresentado o plano de partilha do espólio de Ari Fernandes de Souza, onde foram atualizados os valores dos imóveis registrados sob as matrículas 10.333 e 24.048 (avaliados em R$ 1.956.585,00) e a matrícula 7.412 (avaliada em R$ 717.250,00). O inventariante solicitou a manutenção do valor da causa de forma simbólica, justificando o pedido com base no inventário negativo, dado que as dívidas do espólio, originadas de processos datados de 1989, são de montantes significativos. A partilha dos bens foi apresentada de forma igualitária entre os herdeiros, e a homologação do plano de partilha foi requerida, assim como o prosseguimento do feito. O tempo despendido foi de 01h25min, com valor da hora de R$ 402,84, totalizando R$ 570,69. O status da atividade está faturado e a solicitação de aprovação foi enviada para Rafael Mayer da Silva.','4. Caixa_104',1,'2026-01-07 23:27:21','2026-01-07 23:27:21'),
(1232,723306,'2024-09-20',9,2024,550.55,'3.01 RESULTADO OPERACIONAL:3.01.01 RECEITA BRUTA:3.01.01.02 - Receita Bruta - Contrato PJ','3.01.01.02','RECEITA_PJ',0,'Estaco Estaqueamento e Construcoes Eireli','1. Atividades Judiciais Contenciosas ou Voluntárias','Relatório referente à atividade judicial contenciosa realizada em 09/09/2024 no processo nº 5077417-31.2020.8.24.0023, envolvendo a empresa Estaco Estaqueamento e Construções Eireli, como autora, e o Município de Florianópolis e Concretil Construções LTDA, como réus. A atuação foi no procedimento contencioso, com foco em um recurso de embargos de declaração. O tempo de dedicação foi de 1 hora e 22 minutos, com valor da hora estipulado em R$ 402,84, resultando em um valor total de R$ 897,69. A atividade está faturada e a solicitação de aprovação foi enviada para Rafael Mayer da Silva. A atividade realizada foi relativa a recursos.','4. Caixa_104',1,'2026-01-07 23:27:21','2026-01-07 23:27:21'),
